## The Problem

We have a Tooltip component that we want to use in different parts of our NextJS application. The problem is that we want to be able to close the previously opened Tooltip when a new one is opened.

Since this is a component used in different places but don't have a scope context and are therefore isolated from itself.

## The Solution

To solve this problem, we can use React Context to create a global state for the Tooltip component. This way, we can access and update the state from any component that uses the Tooltip.

Here's how we can implement it:

1. Create a new file called `TooltipContext.js` in the `context` folder.

```javascript
import React, { createContext, useState } from 'react';

export const TooltipContext = createContext();

export const TooltipProvider = ({ children }) => {
  const [activeTooltip, setActiveTooltip] = useState(null);

  const openTooltip = (id) => {
    if (activeTooltip === id) {
      setActiveTooltip(null);
    } else {
      setActiveTooltip(id);
    }
  };

  return (
    <TooltipContext.Provider value={{ activeTooltip, openTooltip }}>
      {children}
    </TooltipContext.Provider>
  );
};
```

In this file, we create a new context called `TooltipContext` and a provider component called `TooltipProvider`. The provider component has a state called `activeTooltip` that keeps track of the currently active tooltip. We also have a function called `openTooltip` that takes an `id` as a parameter and toggles the `activeTooltip` state.

2. Wrap the entire application with the `TooltipProvider` component in `_app.js`.

```javascript
import { TooltipProvider } from '../context/TooltipContext';

function MyApp({ Component, pageProps }) {
  return (
    <TooltipProvider>
      <Component {...pageProps} />
    </TooltipProvider>
  );
}

export default MyApp;
```

3. Create a new file called `Tooltip.js` in the `components` folder.

```javascript
import React, { useContext } from 'react';
import { TooltipContext } from '../context/TooltipContext';

const Tooltip = ({ id, children, content }) => {
  const { activeTooltip, openTooltip } = useContext(TooltipContext);

  return (
    <div
      className={`tooltip ${activeTooltip === id ? 'active' : ''}`}
      onMouseEnter={() => openTooltip(id)}
      onMouseLeave={() => openTooltip(null)}
    >
      {children}
      <div className="tooltip-content">{content}</div>
    </div>
  );
};

export default Tooltip;
```

In this file, we import the `TooltipContext` and use the `useContext` hook to access the `activeTooltip` and `openTooltip` functions. We also pass an `id` prop to the `Tooltip` component, which we use to toggle the `activeTooltip` state.

4. Use the `Tooltip` component in any component that needs it.

```javascript
import Tooltip from '../components/Tooltip';

const Home = () => {
  return (
    <div>
      <Tooltip id="1" content="This is tooltip 1">
        <button>Tooltip 1</button>
      </Tooltip>
      <Tooltip id="2" content="This is tooltip 2">
        <button>Tooltip 2</button>
      </Tooltip>
      <Tooltip id="3" content="This is tooltip 3">
        <button>Tooltip 3</button>
      </Tooltip>
    </div>
  );
};

export default Home;
```

In this example, we use the `Tooltip` component three times with different `id` props. When we hover over a button, the corresponding tooltip is displayed, and when we hover over another button, the previously opened tooltip is closed, and the new tooltip is opened.

