  "version": "1.0",
  "description": "Take screenshots of the current tab and save them to the desktop",
  "icons": {
    "16": "icons/icon16.png",
    "48": "icons/icon48.png",
    "128": "icons/icon128.png"
  },
  "background": {
    "scripts": ["background.js"],
    "persistent": false
  },
  "browser_action": {
    "default_icon": "icons/icon48.png",
    "default_popup": "popup.html"
  },
  "permissions": [
    "activeTab",
    "<all_urls>",
    "downloads"
  ]
}
```

3. Edit `background.js`:

```javascript
chrome.browserAction.onClicked.addListener((tab) => {
  chrome.tabs.captureVisibleTab((screenshotUrl) => {
    const viewTabUrl = chrome.extension.getURL("popup.html?tabId=" + tab.id);
    chrome.tabs.create({ url: viewTabUrl }, (createdTab) => {
      chrome.tabs.onUpdated.addListener((tabId, changeInfo, tab) => {
        if (tabId === createdTab.id && changeInfo.status === "complete") {
          chrome.tabs.sendMessage(createdTab.id, { screenshotUrl });
          chrome.tabs.remove(createdTab.id);
        }
      });
    });
  });
});
```

4. Edit `content.js`:

```javascript
chrome.runtime.onMessage.addListener((request, sender, sendResponse) => {
  if (request.screenshotUrl) {
    const link = document.createElement("a");
    link.href = request.screenshotUrl;
    link.download = `screenshot_${Date.now()}.png`;
    document.body.appendChild(link);
    link.click();
    document.body.removeChild(link);
  }
});
